function Input(props) {
  const {
    labelName,
    labelClass,
    labelSpan,
    spanClass,
    // nameInput,
    typeInput,
    inputId,
    inputValue,
    placeholderInput,
    checked,
    onChange
  } = props;

  return (
    <>
      <input
          checked={checked}
          // disabled={checkInput !== inputId}
          onChange={onChange}
          // onChange={onCheckedChange}
          type={typeInput}
          name={typeInput}
          id={inputId}
          value={inputValue}
          placeholder={placeholderInput}
        />
    <label for={input} className={labelClass}>
        {labelName}
        <span className={spanClass}>{labelSpan}</span>
        </label>
    </>
  );
}

export default Input;
